import { fetchProducts } from '../actions'
import { connect } from 'react-redux'


let ButtonState = ( props) => (<button
    onClick={() => { props.getProducts(); }}>
    Get Products
  </button>
);

// const mapStateToProps = (state) => ({
// //     products: state
// })

const mapDispatchToProps = {
  getProducts: fetchProducts
}

connect(
  mapDispatchToProps,
  null
)(ButtonState)


 Button;
